script: |
  super -f text -I q7657.spq | sort > q7657.out

inputs:
  - name: q7657.spq
    data: |
      SELECT DISTINCT cor0.col0 + cor0.col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 + col2 NOT BETWEEN + col0 AND - col1 / + col0;
  - name: tab2

outputs:
  - name: q7657.out
    data: |
      137
      38
      96
